static inline bool aux_sym_variable_token1_character_set_1(int32_t c) {
  return (c < '+'
    ? (c < ' '
      ? (c < '\t'
        ? c == 0
        : c <= '\r')
      : (c <= '!' || (c >= '#' && c <= '$')))
    : (c <= '+' || (c < '?'
      ? (c < '='
        ? c == ':'
        : c <= '=')
      : (c <= '?' || c == '\\'))));
}

static inline bool aux_sym_pattern_immd_token1_character_set_1(int32_t c) {
  return (c < '('
    ? (c < ' '
      ? (c < '\t'
        ? c == 0
        : c <= '\r')
      : (c <= ' ' || (c >= '#' && c <= '&')))
    : (c <= ')' || (c < '\\'
      ? (c < '='
        ? c == ':'
        : c <= '=')
      : (c <= '\\' || c == '}'))));
}

